import React from "react";
import Experience from "./Experience";

function Experiences() {
  const Experiences = [
    {
      title: "Software Engineer",
      company: "hudl",
      startDate: "May 2024",
      endDate: "August 2024",
      description:
        "Worked as a software engineering intern leveraged React, C#, and React Native to work on hudl messaging.",
    },
    {
      title: "Software Engineer",
      company: "hudl",
      startDate: "May 2024",
      endDate: "August 2024",
      description:
        "Worked as a software engineering intern leveraged React, C#, and React Native to work on hudl messaging.",
    },
    {
      title: "Software Engineer",
      company: "hudl",
      startDate: "May 2024",
      endDate: "August 2024",
      description:
        "Worked as a software engineering intern leveraged React, C#, and React Native to work on hudl messaging.",
    },
  ];
  return (
    (<h1>Experiences</h1>),
    Experiences.map((experience) => {
      return (
        <Experience
          title={experience.title}
          company={experience.company}
          startDate={experience.startDate}
          endDate={experience.endDate}
          description={experience.description}
        />
      );
    })
  );
}

export default Experiences;
